import { Fragment } from 'react';
import React from 'react';
import './Header.css';
import Navigation from '../Navigation/navigation';
import Logo from '../logo/logo';

const Header=()=>{
    
    return(
            <Fragment>
                <div className="Header">
                    <div className='logo'>
                        <Logo></Logo>
                    </div>
               <Navigation></Navigation>
                </div>
            </Fragment>
    );
};

export default Header;
